import axios from "axios"

const fetchImage = ({ value, page }) => {


    return axios
        .get(`https://pixabay.com/api/?q=${value}&page=${page}&key=19685928-f191ac91b9da632ea9a4b744f&image_type=photo&orientation=horizontal&per_page=12`)
}

export default fetchImage;
